	/*
     * private method: initNetwork(msg)
     *
     * Connects to the server and initialize the various
     * callbacks.
     */
	 
    var initNetwork = function() {
        // Attempts to connect to game server
        try {
            socket = new SockJS("http://localhost:4000/SaveHer");
			
			socket.onopen = function() {
				console.log("socket to server ready");
				socketReady = true;
			}

            socket.onmessage = function (e) {
                var message = JSON.parse(e.data);
                switch (message.type) {
				
					case "new_player":
						playerID = message.playerID;
						setCookie("player",playerID,1);
						//console.log(playerName + " " + playerID);
						break;
					case "relog_player":	
						player = message.player;
						playerName = player.name;
						character = player.character;
						console.log("received relog_player "+player+" "+playerName+" "+character+" "+avatar);
						showMainLobby();
						break;
					case "join_game":
						//console.log("joining game...");
						map = message.map;
						port = message.port;
						player = message.player; //receive updated copy of the player object
						console.log("received join_game map = " + map + " and port = " + port);
						$(stage.canvas).fadeOut();
						connectGame();
						break;
					case "new_game":
						session = message.sessionID;
						port = message.port;
						player = message.player; //receive updated copy of the player object
						//console.log("received new_game from server, sessionID = #" + session);
						console.log("received new_game map = " + map + " and port = " + port);
						$(stage.canvas).fadeOut();
						connectGame();
						break;
					case "PlayerNotFound":
						showLogin();
						break;
					case "get_all_sessions":
						sessionCount=0;
						allSessions = message.allSessions;
						//console.log("received all sessions, checking now:");
						for (var j = 0; j < allSessions.length; j++){
							if (allSessions[j]!= undefined){
								sessionCount++;
							}
						}
						break;
				}
            }
        } catch (e) {
            console.log("Failed to connect to server");
        }
    }
		
